import axios from "axios";
import { useEffect, useState } from "react";
import {  Link } from "react-router-dom";

import { w3cwebsocket as W3CWebSocket } from "websocket";

export default function GetNumber() {

    window.WebSocket = window.WebSocket || window.MozWebSocket;
    const client = new W3CWebSocket('ws://localhost:3000', 'echo-protocol');
    const contentDefaultMessage = "Start writing your document here";

    client.onopen = function () {
        // client is opened and ready to use
        alert('client Open');
      };

      client.onerror = function (error) {
        // an error occurred when sending/receiving data
        alert('Error');
      };

      client.onmessage = function (message) {
        alert('Message');

      };

    const [counts, setCounts] = useState([]);
    useEffect(() => {
        getCounts();
    }, []);


    function getCounts() {
        axios.get('http://localhost:8080/redomat/react-multi-page-website/api/counts/').then(function(response) {
            console.log(response.data);
            setCounts(response.data);
        });
    }

    function reserveNumber(){
        axios.put(`http://localhost:8080/redomat/react-multi-page-website/api/counts/get`).then(function(response) {
            console.log(response.data);
            setCounts(response.data);
        });
    }

    /*const deleteUser = (id) => {
        axios.delete(`http://localhost:8888/api/user/${id}/delete`).then(function(response){
            console.log(response.data);
            getUsers();
        });
    }*/
    return (
        <div>
            <h1>Uzmite broj</h1>
            <h2>Trenutni broj:</h2>
            <h2>{counts.current_number}</h2>

            <button onClick={() => reserveNumber()}>Uzmite broj</button>

            <h2>Rezervisanih brojeva:</h2>
            <h2>{counts.reserved_number}</h2>
        </div>
    )
}
